import { GET_PERMISSION, UPDATE_PERMICSSION } from "../actions/actionsTypes";

const initialState = [];

export default (state = initialState, { type, payload }) => {
    switch (type) {

        case GET_PERMISSION:
        case UPDATE_PERMICSSION:
            return [...payload]

        default:
            return state
    }
}
